import React, { useEffect, useState } from "react";

export const Home = () => {
  const [products, setproduct] = useState([]);
  const fetchProduct = () => {
    fetch("https://dummyjson.com/products")
      .then((res) => res.json())
      .then((res) => setproduct(res.products));
  };

  useEffect(() => {
    fetchProduct();
  }, []);

  console.log(products);

  return <div>{products.map(product)}</div>;
};
